CREATE TABLE [Customer] (
    [customerId] int NOT NULL IDENTITY,
    [document] nvarchar(max) NULL,
    [customerName] nvarchar(max) NULL,
    CONSTRAINT [PK_Customer] PRIMARY KEY ([customerId])
);

